    if(letter_input == 0x1C) return TRUE;
    if(letter_input == 0x32) return TRUE;
    if(letter_input == 0x21) return TRUE;
    if(letter_input == 0x23) return TRUE;
    if(letter_input == 0x24) return TRUE;
    if(letter_input == 0x2B) return TRUE;
    if(letter_input == 0x34) return TRUE;
    if(letter_input == 0x33) return TRUE;
    if(letter_input == 0x43) return TRUE;
    if(letter_input == 0x3B) return TRUE;
    if(letter_input == 0x42) return TRUE;
    if(letter_input == 0x4B) return TRUE;
    if(letter_input == 0x3A) return TRUE;
    if(letter_input == 0x31) return TRUE;
    if(letter_input == 0x44) return TRUE;
    if(letter_input == 0x4D) return TRUE;
    if(letter_input == 0x15) return TRUE;
    if(letter_input == 0x2D) return TRUE;
    if(letter_input == 0x1B) return TRUE;
    if(letter_input == 0x2C) return TRUE;
    if(letter_input == 0x3C) return TRUE;
    if(letter_input == 0x2A) return TRUE;
