void swap(int* a, int* b){
    int temp = *a;
    *a = *b;
    *b = temp;
}

void draw_line(int x0, int y0, int x1, int y1, short int color){
    bool steep = abs(y1-y0) > abs(x1-x0);
    if(steep){
        swap(&x0 , &y0);
        swap(&x1,&y1);
    }
    if(x0>x1){
        swap(&x0,&x1);
        swap(&y0,&y1);
    }

    int delx = x1 - x0;
    int dely = abs(y1-y0);
    int error = -delx/2;
    int y = y0;
    int ystep;

    if(y0<y1){
       ystep = 1; 
    }
    else{
        ystep = -1;
    }

    for(int x = x0; x <= x1; x++){
        if(steep){
            plot_pixel(y,x,color);
        }
        else{
            plot_pixel(x,y,color);
        }
        error = error + dely;
        if(error >= 0){
            y += ystep;
            error -= delx;
        }
    }
}

void draw_img(int x0, int y0, const int byteArr[], int height, int width) {
    int color_index = 0;
    for (int y = 0; y < height; y++) {
        for (int x = 0; x < height; x++) {
            int x_coord = x0 + x;
            int y_coord = y0 + y;

            if (byteArr[color_index] != 0b1111100000011111 && x_coord >= 0 && y_coord >= 0 && x_coord <= 319 && y_coord <= 239) {
                plot_pixel(x_coord, y_coord, byteArr[color_index]);
                color_index += 1;
            }
        }
    }
}

void draw_wordle_box(int xpos, int ypos) {
    draw_line(xpos, ypos, xpos + BOX_LEN, ypos, WHITE);
    draw_line(xpos, ypos + BOX_LEN, xpos + BOX_LEN, ypos + BOX_LEN, WHITE);
    draw_line(xpos, ypos, xpos, ypos + BOX_LEN, WHITE);
    draw_line(xpos + BOX_LEN, ypos, xpos + BOX_LEN, ypos + BOX_LEN, WHITE);
}

void draw_grid() {
    for (int y = 17; y <= 212; y += BOX_LEN + 5) {
        for (int i = 75; i <= 225; i += BOX_LEN + 5) {
            draw_wordle_box(i, y);
        }
    }
}

void draw_box(short int color, int xpos, int ypos) {
    // Draw a mXm box, where m is BOX_LEN value
    for(int x = 0; x < BOX_LEN; x++) {
        for(int y = 0; y < BOX_LEN; y++) {
            plot_pixel(xpos + x, ypos + y, color);
        }
    }
}

char* pick_random_word(char** word_array) {

    // Find the size of the array
    int word_array_size = sizeof(word_array)/ sizeof(word_array[0]);

    int random_index = rand() % word_array_size;
    char* selected_word = word_array[random_index];

    return selected_word;
}

int convert_to_code(char letter) {

    int char_code;

    switch(letter) {
        case 'a':
            char_code = 0x1C;
        break;
        case 'b':
            char_code = 0x32;
        break;
        case 'c':
            char_code = 0x21;
        break;
        case 'd':
            char_code = 0x23;
        break;
        case 'e':
            char_code = 0x24;
        break;
        case 'f':
            char_code = 0x2B;
        break;
        case 'g':
            char_code = 0x34;
        break;
        case 'h':
            char_code = 0x33;
        break;
        case 'i':
            char_code = 0x43;
        break;
        case 'j':
            char_code = 0x3B;
        break;
        case 'k':
            char_code = 0x42;
        break;
        case 'l':
            char_code = 0x4B;
        break;
        case 'm':
            char_code = 0x3A;
        break;
        case 'n':
            char_code = 0x31;
        break;
        case 'o':
            char_code = 0x44;
        break;
        case 'p':
            char_code = 0x4D;
        break;
        case 'q':
            char_code = 0x15;
        break;
        case 'r':
            char_code = 0x2D;
        break;
        case 's':
            char_code = 0x1B;
        break;
        case 't':
            char_code = 0x2C;
        break;
        case 'u':
            char_code = 0x3C;
        break;
        case 'v':
            char_code = 0x2A;
        break;
        case 'w':
            char_code = 0x1D;
        break;
        case 'x':
            char_code = 0x22;
        break;
        case 'y':
            char_code = 0x35;
        break;
        case 'z':
            char_code = 0x1A;
        break;
        default:
            char_code = 0x45; // 0
        break;
    }

    return char_code;
}